import { useEffect, useState } from 'react';
import { Link } from 'react-scroll';
import { BrowserRouter as Router } from 'react-router-dom';
import { motion, useScroll, useTransform } from 'framer-motion';
import './App.css';

function App() {
  const [scrollY, setScrollY] = useState(0);
  const { scrollYProgress } = useScroll();

  // Parallax and fade animations
  const opacity = useTransform(scrollYProgress, [0, 0.5, 1], [1, 0.5, 0]);
  const scale = useTransform(scrollYProgress, [0, 0.5, 1], [1, 0.95, 0.9]);

  useEffect(() => {
    const handleScroll = () => {
      setScrollY(window.scrollY);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  // Animation variants for sections
  const fadeInUp = {
    initial: { opacity: 0, y: 60 },
    animate: { opacity: 1, y: 0 },
    transition: { duration: 0.6, ease: "easeOut" }
  };

  const staggerContainer = {
    initial: {},
    animate: {
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const [selectedExp, setSelectedExp] = useState(null);

  const experiences = [
    {
      company: "UMass Boston",
      position: "Intern - Software Engineer",
      period: "August 2024 - Present",
      description: "Developing AI-powered developer tools and improving code intelligence systems.",
      technologies: ["React", "Python", "Node.js"],
      detailedDescription: [
        "Led the development of AI-powered code completion features",
        "Improved code intelligence systems using machine learning",
        "Collaborated with cross-functional teams to deliver new features",
        "Optimized performance and reduced latency by 40%"
      ]
    },
    {
      company: "UMass Boston",
      position: "Research Assistant",
      period: "August 2023 - May 2024",
      description: "Worked on cloud infrastructure and developed scalable solutions.",
      technologies: ["Cloud", "Java", "Kubernetes"],
      detailedDescription: [
        "Developed scalable cloud infrastructure solutions",
        "Implemented new features for Google Cloud Platform",
        "Optimized container orchestration workflows",
        "Contributed to internal testing frameworks"
      ]
    },
    {
      company: "UMass Boston",
      position: "Grader - Programming in C",
      period: "October 2022 - May 2023",
      description: "Enhanced Azure services and implemented new features.",
      technologies: ["Azure", "C#", ".NET"],
      detailedDescription: [
        "Enhanced Azure cloud services with new features",
        "Developed microservices using .NET Core",
        "Implemented automated testing solutions",
        "Collaborated with senior engineers on architecture design"
      ]
    },
    {
      company: "London Stock Exchange Group",
      position: "Senior Software Engineer",
      period: "April 2022 - August 2023",
      description: "Enhanced Azure services and implemented new features.",
      technologies: ["Azure", "C#", ".NET"],
      detailedDescription: [
        "Enhanced Azure cloud services with new features",
        "Developed microservices using .NET Core",
        "Implemented automated testing solutions",
        "Collaborated with senior engineers on architecture design"
      ]
    },
    {
      company: "Refinitiv",
      position: "Associate Software Engineer",
      period: "July 2019 - April 2022",
      description: "Enhanced Azure services and implemented new features.",
      technologies: ["Azure", "C#", ".NET"],
      detailedDescription: [
        "Enhanced Azure cloud services with new features",
        "Developed microservices using .NET Core",
        "Implemented automated testing solutions",
        "Collaborated with senior engineers on architecture design"
      ]
    },
    {
      company: "Refinitiv (Thomson Reuters)",
      position: "Intern",
      period: "January 2019 - June 2019",
      description: "Contributing to the development, optimization, and debugging of C#-based products",
      technologies: ["C#", "ASP.NET", "Knockout.js"],
      detailedDescription: [
        "Collaborated in enhancing features for a single-page application, improving overall user experience and interface design.",
        "Implemented new functionalities and optimized existing ones to ensure seamless performance and responsiveness.",
        "Worked closely with the development team to address bugs and perform testing, ensuring a smooth user experience.",
        "Utilized modern JavaScript frameworks to add dynamic content and improve the applicationâ€™s speed."
      ]
    }
  ];

  return (
    <Router>
      <div className="App">
        <nav className="navbar">
          <ul>
            {['intro', 'experience', 'projects', 'skills', 'education'].map((section) => (
              <motion.li
                key={section}
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.95 }}
              >
                <Link
                  to={section}
                  spy={true}
                  smooth={true}
                  offset={-70}
                  duration={800}
                  className="nav-link"
                >
                  {section.charAt(0).toUpperCase() + section.slice(1)}
                </Link>
              </motion.li>
            ))}
          </ul>
        </nav>

        <motion.section 
          id="intro" 
          className="section intro-section"
        >
          <div className="greeting">
            <motion.h2
              initial={{ opacity: 0, scale: 0.5 }}
              animate={{ 
                opacity: 1, 
                scale: [0.5, 10.5, 1]
              }}
              transition={{ 
                duration: 2.8,
                scale: {
                  times: [0, 5.5, 10],
                  type: "spring",
                  damping: 8,
                  stiffness: 100
                }
              }}
            >
              Hey there! ðŸ‘‹
            </motion.h2>
          </div>

          <motion.div 
            className="profile-content"
            initial={{ opacity: 0, y: 100 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
          >
            <motion.div 
              className="profile-image-container"
              whileHover={{ scale: 1.05 }}
              transition={{ type: "spring", stiffness: 300 }}
            >
              <img 
                src={process.env.PUBLIC_URL + '/profile-picture.jpeg'} 
                alt="Prarthana Prathap" 
                className="profile-image"
              />
            </motion.div>
            <motion.h1 
              className="name"
              initial={{ opacity: 0, x: -100 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ delay: 0.2 }}
            >
              Prarthana Prathap
            </motion.h1>
            <motion.p 
              className="tagline"
              initial={{ opacity: 0, x: 100 }}
              animate={{ opacity: 1, x: 0 }}
              transition={{ delay: 0.4 }}
            >
              Full Stack Developer & Tech Enthusiast
            </motion.p>
            <motion.div 
              className="social-links"
              variants={staggerContainer}
              initial="initial"
              animate="animate"
            >
              <motion.a 
                href="https://github.com/Prarthana-Prathap" 
                target="_blank" 
                rel="noopener noreferrer"
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.95 }}
              >
                GitHub
              </motion.a>
              <motion.a 
                href="https://www.linkedin.com/in/prarthanaprathap/" 
                target="_blank" 
                rel="noopener noreferrer"
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.95 }}
              >
                LinkedIn
              </motion.a>
            </motion.div>
          </motion.div>
        </motion.section>

        <motion.section 
          id="experience" 
          className="section"
          {...fadeInUp}
        >
          <motion.h2 
            initial={{ opacity: 0 }} 
            whileInView={{ opacity: 1 }}
            className="section-title"
          >
            Experience
          </motion.h2>
          <motion.div 
            className="experience-container"
            variants={staggerContainer}
            initial="initial"
            whileInView="animate"
          >
            {experiences.map((exp, index) => (
              <motion.div 
                key={exp.company}
                className="experience-card"
                variants={fadeInUp}
                custom={index}
                whileHover={{ scale: 1.02 }}
                onClick={() => setSelectedExp(exp)}
              >
                <h3>{exp.company}</h3>
                <h4>{exp.position}</h4>
                <p className="period">{exp.period}</p>
                <p className="description">{exp.description}</p>
                <div className="technologies">
                  {exp.technologies.map(tech => (
                    <span key={tech} className="tech-tag">{tech}</span>
                  ))}
                </div>
              </motion.div>
            ))}
          </motion.div>

          {selectedExp && (
            <motion.div 
              className="modal-backdrop"
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              exit={{ opacity: 0 }}
              onClick={() => setSelectedExp(null)}
            >
              <motion.div 
                className="modal-content"
                initial={{ scale: 0.5, opacity: 0 }}
                animate={{ scale: 1, opacity: 1 }}
                exit={{ scale: 0.5, opacity: 0 }}
                onClick={e => e.stopPropagation()}
              >
                <button 
                  className="modal-close"
                  onClick={() => setSelectedExp(null)}
                >
                  Ã—
                </button>
                <h2>{selectedExp.company}</h2>
                <h3>{selectedExp.position}</h3>
                <p className="modal-period">{selectedExp.period}</p>
                <div className="modal-technologies">
                  {selectedExp.technologies.map(tech => (
                    <span key={tech} className="tech-tag">{tech}</span>
                  ))}
                </div>
                <div className="modal-description">
                  <ul>
                    {selectedExp.detailedDescription.map((point, index) => (
                      <li key={index}>{point}</li>
                    ))}
                  </ul>
                </div>
              </motion.div>
            </motion.div>
          )}
        </motion.section>

        <motion.section 
          id="projects" 
          className="section"
          {...fadeInUp}
        >
          <motion.h2 initial={{ opacity: 0 }} whileInView={{ opacity: 1 }}>Projects</motion.h2>
          <motion.div 
            className="projects-grid"
            variants={staggerContainer}
            initial="initial"
            whileInView="animate"
          >
            <motion.div 
              className="project-card"
              variants={fadeInUp}
              whileHover={{ 
                scale: 1.05,
                boxShadow: "0px 8px 30px rgba(0, 0, 0, 0.1)"
              }}
            >
              <h3>Project Name</h3>
              <p>Project description goes here</p>
              <div className="tech-stack">
                <motion.span whileHover={{ scale: 1.1 }}>React</motion.span>
                <motion.span whileHover={{ scale: 1.1 }}>Node.js</motion.span>
                <motion.span whileHover={{ scale: 1.1 }}>MongoDB</motion.span>
              </div>
              <div className="project-links">
                <motion.a 
                  href="#" 
                  target="_blank" 
                  rel="noopener noreferrer"
                  whileHover={{ scale: 1.1 }}
                  whileTap={{ scale: 0.95 }}
                >
                  Live Demo
                </motion.a>
                <motion.a 
                  href="#" 
                  target="_blank" 
                  rel="noopener noreferrer"
                  whileHover={{ scale: 1.1 }}
                  whileTap={{ scale: 0.95 }}
                >
                  GitHub
                </motion.a>
              </div>
            </motion.div>
          </motion.div>
        </motion.section>

        <motion.section 
          id="skills" 
          className="section"
          {...fadeInUp}
        >
          <motion.h2 
            initial={{ opacity: 0 }} 
            whileInView={{ opacity: 1 }}
            className="section-title"
          >
            Skills
          </motion.h2>
          <motion.div 
            className="skills-container"
            variants={staggerContainer}
            initial="initial"
            whileInView="animate"
          >
            {[
              {
                category: 'Frontend',
                skills: [
                  { name: "React", level: 90 },
                  { name: "JavaScript", level: 85 },
                  { name: "HTML/CSS", level: 95 }
                ]
              },
              {
                category: 'Backend',
                skills: [
                  { name: "Node.js", level: 80 },
                  { name: "Python", level: 85 },
                  { name: "SQL", level: 75 }
                ]
              }
            ].map((category, categoryIndex) => (
              <motion.div 
                key={category.category}
                className="skill-category"
                variants={fadeInUp}
                custom={categoryIndex}
                whileHover={{ scale: 1.02 }}
              >
                <h3>{category.category}</h3>
                <div className="skills-grid">
                  {category.skills.map((skill, skillIndex) => (
                    <motion.div 
                      key={skill.name}
                      className="skill-item"
                      initial={{ opacity: 0, x: -20 }}
                      whileInView={{ opacity: 1, x: 0 }}
                      transition={{ 
                        duration: 0.5,
                        delay: skillIndex * 0.1
                      }}
                      viewport={{ once: true }}
                      whileHover={{ scale: 1.02 }}
                    >
                      <div className="skill-info">
                        <span className="skill-name">{skill.name}</span>
                        <span className="skill-percentage">{skill.level}%</span>
                      </div>
                      <div className="skill-bar-bg">
                        <motion.div 
                          className="skill-bar"
                          initial={{ width: "0%" }}
                          whileInView={{ width: `${skill.level}%` }}
                          transition={{ 
                            duration: 1.2,
                            delay: skillIndex * 0.2,
                            ease: "easeOut"
                          }}
                          viewport={{ once: true }}
                        />
                      </div>
                    </motion.div>
                  ))}
                </div>
              </motion.div>
            ))}
          </motion.div>
        </motion.section>

        <motion.section 
          id="education" 
          className="section"
          {...fadeInUp}
        >
          <motion.h2 initial={{ opacity: 0 }} whileInView={{ opacity: 1 }}>Education</motion.h2>
          <motion.div 
            className="education-container"
            variants={staggerContainer}
            initial="initial"
            whileInView="animate"
          >
            <motion.div 
              className="education-item"
              variants={fadeInUp}
              whileHover={{ scale: 1.02 }}
            >
              <h3>Master of Science in Computer Science</h3>
              <p className="institution">University of Massachusetts, Boston</p>
              <p className="duration">2022 - 2024</p>
              <p className="gpa">GPA: 3.97</p>
              <br/>
              <h3>Bachelor of Engineering in Computer Science and Engineering</h3>
              <p className="institution">University Visvesvaraya College of Engineering</p>
              <p className="duration">2015 - 2019</p>
              <p className="gpa">Aggregate: 81.85%</p>
            </motion.div>
          </motion.div>
        </motion.section>
      </div>
    </Router>
  );
}

export default App;
